import request from "../../utils/request.js";
export default {
    /**
     * 获取最新任务信息
     */
    async getCurrentJob() {
        let _this = this;
        request({
            url: "/job/get_current_job",
            type: 'GET',
            data: '',
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {
                window.clearInterval(_this.setinterval);
                result = JSON.parse(result)
                if (result.length > 0) {
                    _this.missionForm = {
                        missionName: result[0].jobName,
                        missionType: result[0].jobMode,
                        missionStatus: result[0].jobStatus,
                        timesThrowSec: result[0].intervalTime,
                        securityDeepMet: result[0].safeDeep,
                        settingDepth: result[0].setDeep,
                        settingThrowTimes: result[0].dropTimes == -1 ? '无限次' : result[0].dropTimes,
                        thisSettingThrowTimes: result[0].runTimes
                    };
                    _this.realTimeJobId = result[0].jobId;
                    _this.getRealtimeJob(_this.realTimeJobId)
                } else {
                    _this.setinterval = window.setInterval(() => {
                        _this.getCurrentJob()
                    }, 1000);
                }
                // alert(result);
            },
            //异常处理
            error: function(e) {
                // console.log(e);
                // alert(e);
            }
        })
    },

    /**
     * 获取当前任务信息
     */
    async getRealtimeJob(jobId) {
        let _this = this;
        request({
            url: "/job/get_job_realdata",
            type: 'GET',
            data: {
                jobId: jobId,
            },
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {

                result = JSON.parse(result)
                window.clearInterval(_this.setinterval1);
                if (result.length != 0) {
                    _this.missionForm = {
                        missionName: result[0].jobName,
                        missionType: result[0].jobMode,
                        missionStatus: result[0].jobStatus,
                        timesThrowSec: result[0].intervalTime,
                        securityDeepMet: result[0].safeDeep,
                        settingDepth: result[0].setDeep,
                        settingThrowTimes: result[0].dropTimes == -1 ? '无限次' : result[0].dropTimes,
                        thisSettingThrowTimes: result[0].runTimes
                    }
                    if (result[0].jobStatus >= 768) {
                        _this.getCurrentJob();
                    } else {
                        _this.setinterval1 = window.setInterval(() => {
                            _this.getRealtimeJob(_this.realTimeJobId);
                        }, 1000)
                    }
                }
            },
            //异常处理
            error: function(e) {
                console.log(e);
            }
        })
    },

    /**
     * 获取ishow 
     * */
    async getishow() {
        let _this = this;
        request({
            url: "/sys-define/get_ishow_define",
            type: 'GET',
            data: '',
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {

                result = JSON.parse(result);
                _this.formArray = JSON.parse(JSON.stringify(result));
            },
            error: function(e) {
                console.log(e);
            }
        })
    },

    getDataSec() {
        let _this = this;
        window.clearInterval(_this.apparatusSetInterval);
        _this.apparatusSetInterval = setInterval(() => {
            _this.getApparatusData({
                thisTimes: _this.thisApparatusTimes,
                limit: _this.thisApparatuslimit
            })
        }, 1000)
    },
    /**
     * 获取仪器实时数据
     */
    async getApparatusData(row) {
        let _this = this;
        request({
            url: "/realtime",
            type: 'GET',
            data: {
                start_time: row.thisTimes,
                limit: row.limit,
            },
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {

                result = JSON.parse(result)
                if (result.length > 0) {
                    // 获取时间
                    _this.apparatusForm = {
                        getDataTime: result[0].timeTag,
                    };
                    _this.thisApparatusTimes = result[0].timeTag;

                    let resultdata = result[0]
                        // input框赋值
                    for (let i in _this.formArray) {
                        for (let j in resultdata) {
                            if (_this.formArray[i].fieldName == j) {
                                _this.formArray[i].vals = resultdata[j];
                            }
                        }
                    };
                    _this.thisApparatuslimit = '';
                }
            },
            error: function(e) {
                console.log(e);
            }
        })
    },

    /**
     * 获取wshow
     * */
    async getwshow() {
        let _this = this;
        request({
            url: "/sys-define/get_wshow_define",
            type: 'GET',
            data: '',
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {
                result = JSON.parse(result);
                _this.formArrayWinch = JSON.parse(JSON.stringify(result));
            },
            error: function(e) {
                console.log(e);
            }
        })
    },

    /**
     * 获取绞车实时数据
     * */
    async getWinchData(row) {
        let _this = this;
        request({
            url: "/winch/get_realdata",
            type: 'GET',
            data: {
                start_time: row.thisTimes,
                limit: row.limit,
            },
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {
                result = JSON.parse(result);
                if (result.length > 0) {
                    let resultUseCharts = JSON.parse(JSON.stringify(result))
                    let resultUseCharts1 = JSON.parse(JSON.stringify(result))
                    for (let i in resultUseCharts[0]) {
                        if (typeof resultUseCharts[0][i] == 'number') {
                            resultUseCharts[0][i] = resultUseCharts[0][i] == null ? 0 : resultUseCharts[0][i].toFixed(2)
                        }
                    }

                    // 获取时间
                    _this.winchForm = {
                        getDataTime: result[0].timeTag,
                    };
                    _this.thisWinchTimes = result[0].timeTag;

                    let resultdata = result[0]
                        // input框赋值
                    for (let i in _this.formArrayWinch) {
                        for (let j in resultdata) {
                            if (_this.formArrayWinch[i].fieldName == j) {
                                _this.formArrayWinch[i].vals = resultdata[j];
                            }

                        }
                    };
                    for (let i in resultUseCharts1[0]) {
                        for (let j in _this.checkboxarray) {
                            for (let k in _this.checkboxarray[j].arr) {
                                if (i == _this.checkboxarray[j].arr[k].fieldName) {
                                    _this.checkboxarray[j].arr[k].value = resultUseCharts1[0][i]
                                }
                            }
                        }
                    }
                    for (let y = 0; y < _this.checkboxarray.length; y++) {
                        for (let u = 0; u < _this.checkboxarray[y].arr.length; u++) {
                            for (let p = 0; p < _this.checkboxarray[y].arr[u].array.length; p++) {
                                _this.checkboxarray[y].arr[u].array[p].checked = false;
                                if ((_this.checkboxarray[y].arr[u].value & _this.checkboxarray[y].arr[u].array[p].dataValue) > 0) {
                                    _this.checkboxarray[y].arr[u].array[p].checked = true
                                }
                            }
                        }
                    }
                }
            },
            error: function(e) {
                console.log(e);
            }
        })
    },

    getWinchDataSec() {
        let _this = this;
        window.clearInterval(_this.winchSetInterval);
        _this.winchSetInterval = setInterval(() => {
            _this.getWinchData({
                thisTimes: _this.thisWinchTimes,
                limit: _this.thisWinchlimit
            })
        }, 1000)
    },
    async getStatusDefine() {
        let _this = this;
        request({
            url: "/winch/get_status_define",
            type: 'GET',
            data: '',
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {
                result = JSON.parse(result);
                _this.checkboxarray = [];
                let b = [];
                let c = [];
                for (let i in result) {
                    if (b.indexOf(result[i].dataType) == -1) {
                        b.push(result[i].dataType)
                    }
                    if (c.indexOf(result[i].fieldName) == -1) {
                        c.push(result[i].fieldName)
                    }
                }
                for (let o = 0; o < b.length; o++) {
                    let a = {
                        name: '',
                        arr: [],
                        dataType: '',
                    };
                    _this.checkboxarray.push(a)
                }
                for (let i = 0; i < b.length; i++) {
                    for (let j = 0; j < result.length; j++) {
                        if (b[i] == result[j].dataType) {
                            _this.checkboxarray[i].dataType = result[j].dataType;
                            if (_this.checkboxarray[i].name == '') {
                                _this.checkboxarray[i].name = result[j].fieldName + ' System'
                            }
                            _this.checkboxarray[i].arr.push(result[j])
                        }
                    }
                }
                let aaa = [];
                for (let i in c) {
                    let bbb = {
                        name: c[i],
                        array: [],
                        value: 0,
                        dataType: '',
                    };
                    aaa.push(bbb)
                }
                for (let i = 0; i < _this.checkboxarray.length; i++) {
                    for (let j = 0; j < _this.checkboxarray[i].arr.length; j++) {
                        for (let k in aaa) {
                            if (aaa[k].name == _this.checkboxarray[i].arr[j].fieldName) {
                                aaa[k].array.push(_this.checkboxarray[i].arr[j]);
                                aaa[k].dataType = _this.checkboxarray[i].arr[j].dataType
                            }
                        }

                    }
                }
                for (let i = 0; i < _this.checkboxarray.length; i++) {
                    _this.checkboxarray[i].arr = [];
                    for (let j = 0; j < aaa.length; j++) {
                        if (_this.checkboxarray[i].dataType == aaa[j].dataType) {
                            for (let k in aaa[j].array) {
                                aaa[j].array[k].checked = false
                            }
                            _this.checkboxarray[i].arr.push({
                                array: aaa[j].array,
                                value: 0,
                                fieldName: aaa[j].name,
                                dataType: aaa[j].dataType,
                            })
                        }
                    }
                }
                _this.readyRenderCheckboxData = true
            },
            error: function(e) {
                console.log(e);
            }
        })
    },

    getAlert() {
        let _this = this;
        window.clearInterval(this.alertSetInterval);
        this.alertSetInterval = window.setInterval(() => {
            _this.getAlarmRealtime({
                time: _this.thisAlertTime,
                limit: _this.thisAlertlimit,
            });
        }, 1000);
    },
    async getAlarmRealtime(row) {
        let _this = this;
        request({
            url: "/sys-define/get_alarm_realtime",
            type: 'GET',
            data: {
                start_time: row.time,
                limit: row.limit,
            },
            dataType: 'json',
            timeout: 200000,
            contentType: "application/json",
            success: function(result) {
                result = JSON.parse(result)
                if (result.length > 0) {
                    for (let i in result) {
                        result[i].timeTags = new Date(result[i].timeTag).getFullYear() + '-' + (new Date(result[i].timeTag).getMonth() + 1 < 10 ? '0' + (new Date(result[i].timeTag).getMonth() + 1) : new Date(result[i].timeTag).getMonth() + 1) + '-' + (new Date(result[i].timeTag).getDate() < 10 ? '0' + new Date(result[i].timeTag).getDate() : new Date(result[i].timeTag).getDate()) + ' ' + (new Date(result[i].timeTag).getHours() < 10 ? '0' + new Date(result[i].timeTag).getHours() : new Date(result[i].timeTag).getHours()) + ':' + (new Date(result[i].timeTag).getMinutes() < 10 ? '0' + new Date(result[i].timeTag).getMinutes() : new Date(result[i].timeTag).getMinutes()) + ':' + (new Date(result[i].timeTag).getSeconds() < 10 ? '0' + new Date(result[i].timeTag).getSeconds() : new Date(result[i].timeTag).getSeconds());
                        _this.alertArray.unshift(result[i]);
                    }
                    _this.thisAlertTime = result[0].timeTag;
                }
            },
            error: function(e) {
                console.log(e);
            }
        })
    },

}
